import React, {Component} from 'react';
import {Link, NavLink} from 'react-router-dom';

class Header extends Component {
  constructor(props) {
    super(props);

    this.state = {
      page: this.props.page
    }
  }

  renderPages() {
    console.log(this.state.page);
    if (this.state.page === 0) {
      return (
        <div className="App-header-pages">
          <button type="button">
            <Link to="/"><span id="headerActive">about</span></Link>
          </button>
          <button type="button">
            <Link to="/work"><span id="buttonLink">work</span></Link>
          </button>
        </div>
      );
    } else if (this.state.page === 1) {
      return (
        <div className="App-header-pages">
          <button type="button">
            <Link to="/"><span id="buttonLink">about</span></Link>
          </button>
          <button type="button">
            <Link to="/work"><span id="headerActive">work</span></Link>
          </button>
        </div>
      );
    } else {
      return (
        <div className="App-header-pages">
          <button type="button">
            <Link to="/"><span id="buttonLink">about</span></Link>
          </button>
          <button type="button">
            <Link to="/work"><span id="buttonLink">work</span></Link>
          </button>
        </div>
      );
    }
  }

  render() {
    return (
      <header className="App-header">
        <div>
          <button type="button" className="App-header-name">
            <Link to="/">meredith young-ng</Link>
          </button>
        </div>
        <div className="App-header-pages">
          <button type="button">
            <NavLink activeClassName="headerActive" to="/"><span id="buttonLink">about</span></NavLink>
          </button>
          <button type="button">
            <NavLink activeclassName="headerActive" to="/work"><span id="buttonLink">work</span></NavLink>
          </button>
        </div>
      </header>
    );
  }
}

export default Header;
